script: |
  super -f text -I q6634.spq | sort > q6634.out

inputs:
  - name: q6634.spq
    data: |
      SELECT ALL 17 FROM tab0 (FORMAT parquet) AS cor0 WHERE - ( + col0 ) * + ( - col2 ) + + col1 NOT IN ( col1 + - 65 );
  - name: tab0

outputs:
  - name: q6634.out
    data: |
      17
      17
      17
